import './FilePreview.css';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';

function FilePreview(props) {
  return (
    <div id="previewOverlay">
      <ArrowBackIcon className="preview__close"/>
      {props.media}
    </div>
  )
}

export default FilePreview;
